INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 40011, "リリ", 0, 24001, 321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 125801, 1, 1, 1);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 40011, "クリア", 0, 24001, 322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 126001, 2, 1, 1);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 40011, "プレシア", 0, 24001, 323, "んーと。\nこれ、あげる。\nはい", 126101, 3, 1, 1);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 40011, "リリ", 0, 24001, 324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 125801, 4, 2, 1);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 40011, "クリア", 0, 24001, 325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 126001, 5, 2, 1);
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (2, 40011, "プレシア", 0, 24001, 326, "お兄。\nきてくれて、うれしい", 126101, 6, 2, 1);
